user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.1x1", "{\"row\":\"1\",\"column\":\"1\",\"name\":\"Cash\",\"label\":\"Quick Cash\",\"desc\":\"This function registers a cash payment. The parameter field can be used to program a preset cash apayment amount. If no preset is programmed, the payment amount is read from the input line  If the input line is also blank, a quick cash payment is registered.\",\"access\":\"manager\",\"command\":\"cash\",\"controller\":\"Cart\",\"data\":\"\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.1x2", "{\"row\":\"1\",\"column\":\"2\",\"name\":\"Cash\",\"label\":\"Cash 100\",\"desc\":\"This function registers a cash payment. The parameter field can be used to program a preset cash apayment amount. If no preset is programmed, the payment amount is read from the input line  If the input line is also blank, a quick cash payment is registered.\",\"access\":\"manager\",\"command\":\"cash\",\"controller\":\"Cart\",\"data\":\"100\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.1x3", "{\"row\":\"1\",\"column\":\"3\",\"name\":\"Cash\",\"label\":\"Cash 500\",\"desc\":\"This function registers a cash payment. The parameter field can be used to program a preset cash apayment amount. If no preset is programmed, the payment amount is read from the input line  If the input line is also blank, a quick cash payment is registered.\",\"access\":\"manager\",\"command\":\"cash\",\"controller\":\"Cart\",\"data\":\"500\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.1x4", "{\"row\":\"1\",\"column\":\"4\",\"name\":\"Cash\",\"label\":\"Cash 1000\",\"desc\":\"This function registers a cash payment. The parameter field can be used to program a preset cash apayment amount. If no preset is programmed, the payment amount is read from the input line  If the input line is also blank, a quick cash payment is registered.\",\"access\":\"manager\",\"command\":\"cash\",\"controller\":\"Cart\",\"data\":\"1000\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.2x1", "{\"row\":\"2\",\"column\":\"1\",\"name\":\"PLU Search\",\"label\":\"PLU Search\",\"desc\":\"This function allows the operator to perform a PLU search. No parameter is needed.\",\"access\":\"manager\",\"command\":\"PLUSearchDialog\",\"controller\":\"Main\",\"data\":\"\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.2x2", "{\"row\":\"2\",\"column\":\"2\",\"name\":\"PLU/Barcode\",\"label\":\"PLU / Barcode\",\"desc\":\"This function registers an item by its PLU or Barcode. The PLU or Barcode is read from the input line. The parameter field must not be altered\",\"access\":\"manager\",\"command\":\"sendKeycode\",\"controller\":\"Keypad\",\"data\":\"13\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.2x3", "{\"row\":\"2\",\"column\":\"3\",\"name\":\"Print Receipt\",\"label\":\"Print Receipt\",\"desc\":\"This function causes a receipt to be issued. If a receipt has already been issued for a transaction, it will not be printed again (use bill copy instead.) No parameter is needed.\",\"access\":\"manager\",\"command\":\"printReceipt\",\"controller\":\"Receipt_EPC_ZH\",\"data\":\"\"}");
