user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.3x3", "{\"row\":\"3\",\"column\":\"3\",\"name\":\"View Queue\",\"label\":\"View Queue\",\"desc\":\"This function allows the operator to recall a queued order. No parameter is needed.\",\"access\":\"manager\",\"command\":\"pullQueue\",\"controller\":\"Cart\",\"data\":\"\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.3x4", "{\"row\":\"3\",\"column\":\"4\",\"name\":\"Tray Marker\",\"label\":\"Tray Marker\",\"desc\":\"This function registers a tray marker. The parameter field must not be altered\",\"access\":\"manager\",\"command\":\"addMarker\",\"controller\":\"Cart\",\"data\":\"tray\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.4x1", "{\"row\":\"4\",\"column\":\"1\",\"name\":\"PLUS\",\"label\":\"+\",\"desc\":\"This function registers an addition. The parameter field can be used to program a preset addition amount. If no preset amount is programmed, the amount is read from the input line.\",\"access\":\"manager\",\"command\":\"addSurchargeByNumber\",\"controller\":\"Cart\",\"data\":\"\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.4x2", "{\"row\":\"4\",\"column\":\"2\",\"name\":\"Surcharge\",\"label\":\"%+\",\"desc\":\"This function registers a percentage surcharge. The parameter field can be used to program a preset surcharge. If no preset surcharge is programmed, the surcharge percentage is read from the input line.\",\"access\":\"manager\",\"command\":\"addSurchargeByPercentage\",\"controller\":\"Cart\",\"data\":\"\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.4x3", "{\"row\":\"4\",\"column\":\"3\",\"name\":\"Reduction\",\"label\":\"-\",\"desc\":\"This function registers a reduction. The parameter field can be used to program a preset reduction amount. If no preset amount is programmed, the discount amount is read from the input line.\",\"access\":\"manager\",\"command\":\"addDiscountByNumber\",\"controller\":\"Cart\",\"data\":\"\"}");
user_pref("vivipos.fec.settings.functionpanel.pageKeymapMap.1.4x4", "{\"row\":\"4\",\"column\":\"4\",\"name\":\"Percentage Discount\",\"label\":\"%-\",\"desc\":\"This function registers a percentage-based discount. The parameter field can be used to program a preset percentage. If no preset percentage is programmed, the discount percentage is read from the input line.\",\"access\":\"manager\",\"command\":\"addDiscountByPercentage\",\"controller\":\"Cart\",\"data\":\"\"}");
